import React, { useState } from "react";
import "./CreateCliente.css";
import TextField from '@mui/material/TextField';
import axios from "axios";
import Button from '@mui/material/Button';
import ButtonGroup from '@mui/material/ButtonGroup';
import { useNavigate } from 'react-router-dom';

const CreateCliente = () => {

  const navigate = useNavigate();

  const [formData, setFormData] = useState({
    nome: '',
    cnpj: '',
    telefone: '',
    email: '',
    estado: '',
    dataDeNascimento: '',
    cidade: '',
    cep: '',
  });

  const handleChange = (campo) => (event) => {
    setFormData({ ...formData, [campo]: event.target.value });
  };

  const salvar = async () => {
    try {
      const response = await axios.post('http://localhost:8080/api/cliente', formData);
      console.log(response);
    } catch (error) {
      console.log(error.response);
    }
    console.log('request finished');
  };

  const cancel = () => {
    console.log('cancel');
  };

  const goToAdvogado = () => {
    navigate("/sessao/createAdvogado");
  }

  const goToAssociado = () => {
    navigate("/sessao/createAssociado");
  }

  return (
    <div className="container">
      <div className="row">
        <div className="col-lg-12">
          <div className="bs-component">
            <div style={{ marginTop: '70px' }}>
              <ButtonGroup variant="contained" aria-label="Basic button group">
                <Button style={{ backgroundColor: 'grey' }}>Cliente</Button>
                <Button style={{ backgroundColor: 'white', color: 'grey' }} onClick={goToAdvogado}>Advogado</Button>
                <Button style={{ backgroundColor: 'white', color: 'grey' }} onClick={goToAssociado}>Associado</Button>
              </ButtonGroup>
              <div style={{ width: 1100, height: 470, background: 'white', border: '2px #838383 solid' }}>
                <div style={{ width: 325, height: 50, color: '#838383', fontSize: 27, fontFamily: 'Inter', fontWeight: '700', wordWrap: 'break-word', marginTop: '15px', marginLeft: '90px' }}>Dados</div>
                <div style={{ marginTop: '35px', marginLeft: '50px' }}>
                  <div style={{ width: 461, height: 50, color: '#838383', fontSize: 14, fontFamily: 'Inter', fontWeight: '400', wordWrap: 'break-word' }}>NOME</div>
                  <TextField
                    hiddenLabel
                    id="filled-hidden-label-small"
                    defaultValue=""
                    variant="filled"
                    size="small"
                    style={{ marginTop: '-15px', width: '250px' }}
                    value={formData.nome}
                    onChange={handleChange('nome')}
                  />

                  <div style={{ marginTop: '12px', width: 461, height: 50, color: '#838383', fontSize: 14, fontFamily: 'Inter', fontWeight: '400', wordWrap: 'break-word' }}>CPF/CNPJ</div>
                  <TextField
                    hiddenLabel
                    id="filled-hidden-label-small"
                    defaultValue=""
                    variant="filled"
                    size="small"
                    style={{ marginTop: '-15px', width: '250px' }}
                    type="password"
                    value={formData.cnpj}
                    onChange={handleChange('cnpj')}
                  />

                  <div style={{ marginTop: '12px', width: 461, height: 50, color: '#838383', fontSize: 14, fontFamily: 'Inter', fontWeight: '400', wordWrap: 'break-word' }}>TELEFONE</div>
                  <TextField
                    hiddenLabel
                    id="filled-hidden-label-small"
                    defaultValue=""
                    variant="filled"
                    size="small"
                    style={{ marginTop: '-15px', width: '250px' }}
                    value={formData.telefone}
                    onChange={handleChange('telefone')}
                  />

                  <div style={{ marginTop: '12px', width: 461, height: 50, color: '#838383', fontSize: 14, fontFamily: 'Inter', fontWeight: '400', wordWrap: 'break-word' }}>EMAIL</div>
                  <TextField
                    hiddenLabel
                    id="filled-hidden-label-small"
                    defaultValue=""
                    variant="filled"
                    size="small"
                    style={{ marginTop: '-15px', width: '250px' }}
                    value={formData.email}
                    onChange={handleChange('email')}
                  />

                  <div style={{ marginTop: '12px', width: 461, height: 50, color: '#838383', fontSize: 14, fontFamily: 'Inter', fontWeight: '400', wordWrap: 'break-word' }}>ESTADO</div>
                  <TextField
                    hiddenLabel
                    id="filled-hidden-label-small"
                    defaultValue=""
                    variant="filled"
                    size="small"
                    style={{ marginTop: '-15px', width: '250px' }}
                    value={formData.estado}
                    onChange={handleChange('estado')}
                  />
                </div>

                <div style={{ position: 'relative', left: 725, top: -440 }}>
                  <div style={{ marginTop: '12px', color: '#838383', fontSize: 14, fontFamily: 'Inter', fontWeight: '400' }}>CIDADE</div>
                  <TextField
                    hiddenLabel
                    id="filled-hidden-label-small"
                    defaultValue=""
                    variant="filled"
                    size="small"
                    style={{ marginTop: '15px', width: '250px' }}
                    value={formData.cidade}
                    onChange={handleChange('cidade')}
                  />

                  <div style={{ marginTop: '12px', color: '#838383', fontSize: 14, fontFamily: 'Inter', fontWeight: '400' }}>CIDADE</div>
                  <TextField
                    hiddenLabel
                    id="filled-hidden-label-small"
                    defaultValue=""
                    variant="filled"
                    size="small"
                    style={{ marginTop: '15px', width: '250px' }}
                    value={formData.cidade}
                    onChange={handleChange('cidade')}
                  />

                  <div style={{ marginTop: '12px', color: '#838383', fontSize: 14, fontFamily: 'Inter', fontWeight: '400' }}>CEP</div>
                  <TextField
                    hiddenLabel
                    id="filled-hidden-label-small"
                    defaultValue=""
                    variant="filled"
                    size="small"
                    style={{ marginTop: '15px', width: '250px' }}
                    value={formData.cep}
                    onChange={handleChange('cep')}
                  />

                  <div style={{ marginTop: '12px', color: '#838383', fontSize: 14, fontFamily: 'Inter', fontWeight: '400' }}>CEP</div>
                  <TextField
                    hiddenLabel
                    id="filled-hidden-label-small"
                    defaultValue=""
                    variant="filled"
                    size="small"
                    style={{ marginTop: '15px', width: '250px' }}
                    value={formData.cep}
                    onChange={handleChange('cep')}
                  />

                  <div style={{ marginTop: '12px', color: '#838383', fontSize: 14, fontFamily: 'Inter', fontWeight: '400' }}>CEP</div>
                  <TextField
                    hiddenLabel
                    id="filled-hidden-label-small"
                    defaultValue=""
                    variant="filled"
                    size="small"
                    style={{ marginTop: '15px', width: '250px' }}
                    value={formData.cep}
                    onChange={handleChange('cep')}
                  />

                </div>

                <div style={{ marginTop: '20px', marginLeft: '50px' }}>
                  <Button onClick={cancel} variant="contained" style={{ width: 120, height: 40, backgroundColor: 'grey' }}>Cancelar</Button>
                  <Button onClick={salvar} variant="contained" style={{ width: 120, height: 40, backgroundColor: 'grey', marginLeft: '20px' }}>Salvar</Button>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default CreateCliente;
